// Set Custom Attribute for Industry based on Clearbit Reveal tags
// Author: Brian Hall (brian@funnelenvy.com)
// Last modified: 9/21/2017
if (window.reveal && window.reveal.company && window.reveal.company.tags) {
  var  tags = window.reveal.company.tags;
  if (tags.indexOf('Consumer Discretionary') != -1 || tags.indexOf('Consumer Electronics') != -1 || tags.indexOf('Consumer Staples') != -1 || tags.indexOf('Consumer Goods') != -1) {
    window['optimizely'] = window['optimizely'] || [];
    window['optimizely'].push({
      type: 'user',
      attributes: {
        industry: 'Consumer Goods'
      }
    });
  } else if (window.reveal.company.tags.indexOf('Technology') !=-1) {
    window['optimizely'] = window['optimizely'] || [];
    window['optimizely'].push({
      type: 'user',
      attributes: {
        industry: 'Technology'
      }
    });
  } else if (window.reveal.company.tags.indexOf('Financial Services') !=-1) {
    window['optimizely'] = window['optimizely'] || [];
    window['optimizely'].push({
      type: 'user',
      attributes: {
        industry: 'Financial'
      }
    });
  } else if (tags.indexOf('Technology') == -1 && tags.indexOf('Financial Services') == -1 && tags.indexOf('Consumer Discretionary') == -1 && tags.indexOf('Consumer Electronics') == -1 && tags.indexOf('Consumer Staples') == -1 && tags.indexOf('Consumer Goods') == -1) {
    window['optimizely'] = window['optimizely'] || [];
    window['optimizely'].push({
      type: 'user',
      attributes: {
        industry: 'Other Industry'
      }
    });
  }
}

